import React from "react";
import { NavLink } from "react-router-dom";

import "./SideMenuMobileView.css";

const SideMenuMobileView = () => {
  return (
    <div className="mobileSideMenuContainer">
      <ul>
        <li className="sideMenuTitles">
          <NavLink
            exact={true}
            style={{ color: "white", textDecoration: "none" }}
            activeStyle={{ color: "#fa516a" }}
            to={`/${"u2"}/profile`}
          >
            My Collection
          </NavLink>
        </li>

        <li className="sideMenuTitles">
          <NavLink
            exact={true}
            style={{ color: "white", textDecoration: "none" }}
            activeStyle={{ color: "#fa516a" }}
            activeClassName="sideMenuTitlesActive"
            to={`/${"u2"}/profile/categories`}
          >
            Categories
          </NavLink>
        </li>
        <li className="sideMenuTitles">
          <NavLink
            exact={true}
            style={{ color: "white", textDecoration: "none" }}
            activeStyle={{ color: "#fa516a" }}
            activeClassName="sideMenuTitlesActive"
            to={`/${"u2"}/profile/settings`}
          >
            Account Settings
          </NavLink>
        </li>
        <li
          onClick={() =>
            window.confirm("Are you sure you wish to dlog out?") && logout()
          }
          className="sideMenuTitles"
        >
          Log Out
        </li>
      </ul>
    </div>
  );
};

export default SideMenuMobileView;
